const tintColorLight = '#0C6157';
const background = '#fff';
const tintColorDark = '#fff';

export default {
  light: {
    text: '#000',
    background: background,
    tint: tintColorLight,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#fff',
    background: '#000',
    tint: tintColorDark,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorDark,
  }
};
